import React, { Component } from 'react';
import FirstComponent from './components/learning_examples/FirstComponent';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        Hello World <FirstComponent></FirstComponent>
        <SecondComponent></SecondComponent>
        <ThirdComponent></ThirdComponent>
      </div>
    );
  }
}

// Class Components

class SecondComponent extends Component {
  render() {
    return <div className="secondComponent">Second component</div>;
  }
}

//Function Components
function ThirdComponent() {
  return <div className="thirdComponent">Third component</div>;
}

export default App;
